import "./panel.css";

interface panelData {
    width: number;
    height: number;
    data: any;
    panelClass: string;

}

const Panel = ({width, height, data, panelClass}:panelData) => {


    return (
        <div className={panelClass} style={{width, height}}>
            {data}
        </div>
    );
}

export default Panel;
